         "subtitle":"Новите съседи (на испански: La que se avecina, букв. превод Какво се задава в съседство) е испански комедиен сериал,[2] създаден от Алберто Кабайеро, Лаура Кабайеро и Даниел Деорадор за канал Телесинко, чиято премиера е на 22 април 2007 г",
