                  "type":"paragraph",
                  "content":"<p>Paragraph 1.1. Продължение на 1ви параграф!! Test: Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, It has survived not only five centuries2. Paragraph 1 Update Test. UPDATE 1 - Роден е на 24 февруари 1967 г. в град Кордоба (Испания). Израства и прекарва детството и юношеството си в Кордова, докато не напуска работата си в магазина на родителите му и отива да живее в Мадрид, за да стане актьор. <mark class=\"marker-orange\"><strong>През 2004 г. продуцентката Елена Арнао го избира да участва в „Щурите съседи“. Първоначално са му предложили да играе Пако, роля, която в крайна сметка игра Гилермо Ортега. Той не приема и за това му предлагат ролята на портиера Емилио, която ро</strong></mark>ля му позволява да ѝ се наслади повече. Получава множество награди за ролята си на Емилио като някои от тях са, че е \"Най-добрият актьор в „Щурите съседи“. През май 2012 г. започва да участва в „Новите съседи“, където изпълнява ролята на<mark class=\"pen-green\"> Фермин Трухильо</mark>, партньорът на Естела Рейнолдс (Антония Сан Хуан) През 2013 г. той публично разкрива, че е гей.[1] Същата година той има връзка с манекена Мигел Ортис, който е Мистър Гей Испания 2012 г. Няколко месеца по-късно обаче двойката решава да сложи край на връзката си. Приятел е с колежката си Малена Алтерио, с която играят заедно в „Щурите съседи“, както и в други филми и театрални представления.</p>",
