                  "type":"paragraph",
                  "content":"<p>Мирослав Стоянов е роден в град Стара Загора,[1] но според други източници е родом от Варна.[2] Понастоящем живее в Стара Загора.[3] Няма музикално образование, завършил е професионална гимназия по облекло и туризъм с профил „Готварство“.[1][4] Става известен с първата си песен „Но защо така“, последвана от „Целувам те аз“, „Къси гащи“ и „Отиваме на купон“. Гледанията на много от клиповете му надхвърлят сто хиляди, а най-популярните му изпълнения са посетени повече от 1.5 милиона пъти. [5] Той продуцира сам клиповете си, за което също му помагат лични приятели.[2] Изпълненията му добиват голямата си популярност не заради своите музикални качества, колкото заради забавлението, което намират в тях зрителите, споделяйки ги в социалните мрежи като „излагация“ и „смях до скъсване“.[6] В този смисъл Стоянов дори е определян като „българската Ребека Блек“.[6] През юли 2015 осъществява дует с попфолк изпълнителката Кристиана, озаглавен „Цяла нощ“.[5] Участва във „VIP Brother 7“ през септември 2015 г. В края на 2015 година подписва договор с новооткритата музикална компания – Хит Микс Мюзик. На 16 януари Джорджано пуска първия си официален видеоклип и песен заедно с Хит Микс Мюзик, който е озаглавен „1001 нощ“. Песента е трио с Кристиана и Силвър. През месец април излиза песента на Адриана „Лъвица“, която включва Джорджано, а също така участва и във видеоклипа. В края на 2016 година напуска музикалната компания поради финансови затруднен</p>",
